import { useParams } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

// Components
import { Footer } from "../Components/Footer";
import { Header } from "../Components/Header";
import { Form } from "../Components/Sign Up/Form";

// Interface

// Sign Up Form data
interface SignUpFormData {
  title: string;
  description: string;
  formTag1: string;
  formTag2: string;
  formTag3: string;
}

const tempData = {
  business: {
    title: "Business",
    description:
      "Unlock the full potential of our business resources and support. As a member, you'll have access to various resources. With our help, you can take your business to the next level and achieve success!",
    formTag1: "Business Name",
    formTag2: "Owner Full Name",
    formTag3: "Business Description",
  },
  mentor: {
    title: "Mentor",
    description:
      "Unlock the full potential of our mentor resources and support. As a member, you'll have access to various resources. With our help, you can take your mentoring skills to the next level and achieve success!",
    formTag1: "Mentor Name",
    formTag2: "Mentor Email",
    formTag3: "Mentor Description",
  },
  hr: {
    title: "HR",
    description:
      "Unlock the full potential of our HR resources and support. As a member, you'll have access to various resources. With our help, you can take your HR skills to the next level and achieve success!",
    formTag1: "HR Name",
    formTag2: "HR Email",
    formTag3: "HR Description",
  },
};

export const SignUp = () => {
  const [signUpFormType, setSignUpFormType] = useState<SignUpFormData>({
    title: "",
    description: "",
    formTag1: "",
    formTag2: "",
    formTag3: "",
  });

  const [signUpIcon, setSignUpIcon] = useState("");

  const parameters: string | undefined = useParams().user;

  useEffect(() => {
    if (parameters === "business") {
      setSignUpFormType(tempData.business);
    } else if (parameters === "mentor") {
      setSignUpFormType(tempData.mentor);
    } else if (parameters === "hr") {
      setSignUpFormType(tempData.hr);
    } else {
    }
  }, []);

  return (
    <section>
      <Header />
      <main>
        <section className="form-section">
          <Form {...signUpFormType} />
        </section>
        <section className="icon-section"></section>
      </main>
      <Footer />
    </section>
  );
};
